import groovy.json.JsonSlurper

def xresponse = testRunner.testCase.testSteps["车型库列表"].testRequest.response.contentAsString
def slurper = new JsonSlurper()
def result = slurper.parseText(xresponse)
def str = result.data[0].logoURL
//log.info result.data[0].logoURL
def urlList = str.split('\\?')
def url1 = urlList[0]
def ede = urlList[1].split('e=')
def e = ede[1].split('&')
def e1 = e[0]
//log.info e
def tokenList = e[1].split('&')
//log.info tokenList[0]
def token = tokenList[0].split('token=')
def token1 = token[1]
//log.info token1
testRunner.testCase.setPropertyValue( "品牌url", url1 ) 
testRunner.testCase.setPropertyValue( "品牌e", e1 ) 
testRunner.testCase.setPropertyValue( "品牌token", token1 )

