def root = net.sf.json.JSONSerializer.toJSON(messageExchange.responseContent);
//log.info root

//此脚本测试根据brandcarid检索出车辆款式列表中包含热门车型列表中对应的车辆编号carid，且是唯一
//  by manyi
def carlist = root.datalist.data.list
def brandCarId = context.expand('${车辆款式列表#brandCarId}')
def carId = context.expand('${Properties#carId}')
//log.info "carId:" +carId
//log.info "brandCarId:" +brandCarId
def brandCarIderror = "brandCarId不正确"
def CarIderror = "CarId不正确"
def carnum = 0
for (carinfo in carlist){
	if (carinfo.brandCarId.toString() == brandCarId  ) {
	 	if(carinfo.id.toString() == carId){
	 		carnum++;
	 	}
	}
	else
		assert brandCarIderror  ==  ""
}

	if (carnum != 1) {
	 	assert CarIderror  ==  ""
	}

